import React from 'react';

const ExampleCarouselImage = ({ text }) => {
  return (
    <div>
      <img src='https://via.placeholder.com/800x400' alt={text} className='d-block w-100' />
      <div className='caption'>
        <h5>{text}</h5>
      </div>
    </div>
  );
}

export default ExampleCarouselImage;
